// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity >= 0.5.2;

import "../node_modules/openzeppelin-solidity/contracts/token/ERC721/ERC721.sol";
import "../node_modules/openzeppelin-solidity/contracts/token/ERC721/ERC721Metadata.sol";



contract Subfree is ERC721,ERC721Metadata{
   uint256 public counterCanzoni;
   uint Anno;
   address payable owner;
   uint balanceAnnuale;

   struct Ascolti{
     uint256 tokenId;
     uint256 listens;
   }


// ogni canzone ha un suo proprietario
mapping (address => bool) utentiRegistrati;
mapping (address => bool) piattaforme;
Ascolti[] classifica;

constructor(string memory name, string memory symbol) payable public ERC721Metadata(name, symbol){
  owner = msg.sender;
  Anno = block.timestamp + 365 days;
  balanceAnnuale = 0;
}

function Registrati() external payable{
  require(utentiRegistrati[msg.sender] == false, "sei registrato");
  utentiRegistrati[msg.sender] = true;
   //pagamento
  owner.transfer(1 ether);

}

function AddPiattaforme() external{
  piattaforme[msg.sender] = true;

}
// add canzone
function addCanzone(string  memory tokenURI) public {
  // controlla che l'indirizzo del chiamante è diverso da 0
  require(msg.sender != address(0));
  //controlla che il chiamante sia un utente registrato
  require(utentiRegistrati[msg.sender] == true, "Non sei registrato");
  // crea la canzone come nft
  uint256 tokenId = counterCanzoni;
  _safeMint(msg.sender,tokenId);
  //imposta tokenURI
  _setTokenURI(tokenId,tokenURI);
    // incrementa il contatore delle canzoni
  counterCanzoni++;



}

function getTokenId() public view returns(uint256){
  return counterCanzoni;
}

function addAscolti(uint256 id, uint256 listens) external{
  // ottieni ascolti
  require(piattaforme[msg.sender] == true, "Non sei registrato");

  bool esiste =false;
  for (uint256 i= 0; i < counterCanzoni; i++){
    if (classifica[i].tokenId == id){
      classifica[i].listens = listens;
      esiste = true;
    }
  }
  if (!esiste){
    Ascolti memory newAscolti = Ascolti(id,listens);
    classifica.push(newAscolti);
  }

}

function ordinaClassifica() private{
  for (uint256 i = 1;i<counterCanzoni;i++){
    Ascolti memory value= classifica[i];
    uint256 j = i-1;
    while (j>= 0 && classifica[j].listens> value.listens ){
      classifica[j+1] = classifica[j];
      j = j-1;
    }
    classifica[j+1] = value;
  }
}

function pagamentoClassifica() payable public{
  require(msg.sender == owner);
  require(block.timestamp >= Anno);
  ordinaClassifica();
  //30% a noi
  balanceAnnuale -= balanceAnnuale * 30/100 ;
  //20% che verrà spartito tra i top 1000
  uint256 value = balanceAnnuale * 20/100 ;   
  for (uint256 i = 0; i< 1000;i++){
    //20% ai primi mille
    /*address payable autore1 = ownerOf(classifica[i].tokenId);
    autore1.transfer(value/1000);*/
  }
  //il resto spertito tra tutti gli altri
  balanceAnnuale -= value;
  for (uint256 i = 0; i< counterCanzoni;i++){
    /*address payable autore = ownerOf(classifica[i].tokenId);
    autore.transfer(balanceAnnuale/counterCanzoni);*/

  }
  balanceAnnuale = 0;
  Anno =block.timestamp + 365 days;



}

function pagaUtilizzoCanzone() external payable {
  uint256 amount = 3 ether;
  owner.transfer(amount);

  balanceAnnuale += amount;


}




}
